import React from "react";
import Links from "./Links";

function About({ alex }) {

  let alexGit = (alex ? alex.github : "")
  let alexIn = (alex ? alex.linkedin : "")

  return (
    <div id="about">
      <h2>About Me</h2>
      <img src="https://i.imgur.com/mV8PQxj.gif" alt="I made this" />
      <Links github={alexGit} linkedin={alexIn} />
    </div>
  );
}

export default About;
